INSERT INTO alert_rule_metric (CATEGORY, RESOURCE, `TYPE`, CREATE_TIME, UPDATE_TIME, EXPRESSION, MESSAGE_TEMPLATE, METRIC_NAME) VALUES ('NODE', 'CPU', 'METRIC', CURRENT_TIMESTAMP(), CURRENT_TIMESTAMP(), '(1 - (avg by (node)(irate(node_cpu_seconds_total{mode="idle",zone!="external"}[5m])))) * 100 >= %d', '%s %s usage', 'node');
INSERT INTO alert_rule_metric (CATEGORY, RESOURCE, `TYPE`, CREATE_TIME, UPDATE_TIME, EXPRESSION, MESSAGE_TEMPLATE, METRIC_NAME) VALUES ('NODE', 'DISK', 'METRIC', CURRENT_TIMESTAMP(), CURRENT_TIMESTAMP(), '(sum by (node)(node_filesystem_size_bytes{device!~"rootfs|HarddiskVolume.+",node!="", zone!="external"}) - sum  by (node)(node_filesystem_free_bytes{device!~"rootfs|HarddiskVolume.+",node!="", zone!="external"})) / sum by (node)(node_filesystem_size_bytes{device!~"rootfs|HarddiskVolume.+",node!="", zone!="external"}) * 100 >= %d', '%s %s usage', 'node');
INSERT INTO alert_rule_metric (CATEGORY, RESOURCE, `TYPE`, CREATE_TIME, UPDATE_TIME, EXPRESSION, MESSAGE_TEMPLATE, METRIC_NAME) VALUES ('NODE', 'MEMORY', 'METRIC', CURRENT_TIMESTAMP(), CURRENT_TIMESTAMP(), '(1 - sum by (node)(node_memory_MemAvailable_bytes{node!="",zone!="external"}) / sum by (node)(node_memory_MemTotal_bytes{node!="",zone!="external"})) * 100 >= %d', '%s %s usage', 'node');
INSERT INTO alert_rule_metric (CATEGORY, RESOURCE, `TYPE`, CREATE_TIME, UPDATE_TIME, EXPRESSION, MESSAGE_TEMPLATE, METRIC_NAME) VALUES ('POD', 'CPU', 'METRIC', CURRENT_TIMESTAMP(), CURRENT_TIMESTAMP(), '(sum by (pod_name)(rate(container_cpu_usage_seconds_total{container_name!="",container_name!="POD"}[5m])) * 100) >= %d', '%s %s usage', 'pod_name');
INSERT INTO alert_rule_metric (CATEGORY, RESOURCE, `TYPE`, CREATE_TIME, UPDATE_TIME, EXPRESSION, MESSAGE_TEMPLATE, METRIC_NAME) VALUES ('POD', 'MEMORY', 'METRIC', CURRENT_TIMESTAMP(), CURRENT_TIMESTAMP(), '(100 * (sum by(pod) (container_memory_working_set_bytes{container_name!="",container_name!="POD",pod_name=~".*"}) / on (pod) sum by (pod)(container_spec_memory_limit_bytes{container_name!="",container_name!="POD",pod_name=~".*"}) or sum by(pod) (container_memory_working_set_bytes{container_name!="",container_name!="POD",pod_name=~".*"}) / %s) < 500) >= %d', '%s %s usage', 'pod');
